import React from 'react'
import search from '../assets/search.svg'
import pinterest from '../assets/pinterest.svg'
import view_thumbnail from '../assets/view_thumbnail.svg'
import view_uneven from '../assets/view_uneven.svg'
import view_detailed from '../assets/view_detailed.svg'
import { TextField } from '@mui/material'
import { withStyles } from '@mui/styles'

const StyledTextField = withStyles({
    root: {
        '& label.Mui-focused': {
            color: 'white',
        },
        '& .MuiInput-underline:after': {
            borderBottomColor: 'yellow',
        },
        '& .MuiOutlinedInput-root': {
            '& fieldset': {
                borderColor: 'white',
            },
            'fieldset': {
                borderColor: 'white',
            },
            '&:hover fieldset': {
                // borderColor: 'white',
            },
            '&.Mui-focused fieldset': {
                // borderColor: 'yellow',
            },
        },
    },
})(TextField);

export default function Header() {
    return (
        <div className='Header'>
            <img src={pinterest} alt="pinterest" id='appicon' />
            <StyledTextField id="outlined-basic" label="Outlined" variant="outlined" />
        </div>
    )
}
